import React, { ChangeEvent, useState } from 'react';
import Form from './components/Form'
import './App.css';

const App: React.FC = () => {

  const [name, setValue] = useState<string>('0')


  function handleChange(event: ChangeEvent<HTMLInputElement>) {
    setValue(event.target.value)
  }

  return (
    <div className="App">
      <Form />
    </div>
  );
}

export default App;
